import React from 'react';
import {
  Popover,
  Typography,
  Box,
  TextField,
  InputAdornment,
  Divider
} from '@mui/material';
import { useLanguage } from '../../../context/LanguageContext';
import { PRINTER_SPECIFICATIONS } from '../../../config/constants';
import { formatNumber } from '../../../utils/formatters';

/**
 * PrinterInfoPopover Component
 * Displays printer specifications and allows editing initial investment
 */
const PrinterInfoPopover = ({
  open,
  anchorEl,
  handleClose,
  initialInvestment,
  onInitialInvestmentChange,
  error
}) => {
  const { t, language } = useLanguage();

  // Handle input change for initial investment
  const handleInvestmentChange = (event) => {
    const value = event.target.value.replace(/,/g, '');
    const numValue = parseFloat(value);

    if (value === '') {
      onInitialInvestmentChange('');
    } else if (!isNaN(numValue) && numValue > 0) {
      onInitialInvestmentChange(numValue);
    }
  };

  // Format value for display
  const displayValue = initialInvestment === '' 
    ? '' 
    : Number(initialInvestment).toLocaleString(language === 'ja' ? 'ja-JP' : 'en-US');

  // Sample image path - update to actual path
  const sampleImagePath = '/assets/images/lisa.png';

  return (
    <Popover
      open={open}
      anchorEl={anchorEl}
      onClose={handleClose}
      anchorOrigin={{
        vertical: 'bottom',
        horizontal: 'right',
      }}
      transformOrigin={{
        vertical: 'top',
        horizontal: 'right',
      }}
      PaperProps={{
        sx: {
          width: { xs: 320, sm: 450 },
          borderRadius: 2,
          border: '1px solid rgba(150, 170, 200, 0.3)',
          boxShadow: '0 4px 15px rgba(0, 0, 0, 0.08)',
          p: 0,
          overflow: 'hidden'
        }
      }}
    >
      <Box sx={{ p: 3 }}>
        <Typography variant="h6" fontWeight={600} gutterBottom>
          {t('printerSpecifications')}
        </Typography>
      </Box>

      <Divider />

      <Box sx={{ p: 3 }}>
        <Typography variant="h6" fontWeight={500} gutterBottom>
          {t('samplePrint')}
        </Typography>

        <Box sx={{ 
          display: 'flex', 
          justifyContent: 'center', 
          my: 2, 
          px: 2
        }}>
          <Box 
            component="img" 
            src={sampleImagePath} 
            alt="Sample Print"
            sx={{ 
              maxWidth: '100%', 
              height: 'auto',
              borderRadius: 1,
              boxShadow: '0 2px 6px rgba(0,0,0,0.1)'
            }}
          />
        </Box>

        <Typography variant="body2" color="text.secondary" align="center" sx={{ mt: 1, mb: 2 }}>
          {t('simulationImageCaption') || 'Simulations are based on the above image'}
        </Typography>
      </Box>

      <Divider />

      <Box sx={{ p: 3 }}>
        <Typography variant="h6" fontWeight={500} gutterBottom>
          {t('baseParameters')}
        </Typography>

        <Box sx={{ 
          display: 'flex', 
          alignItems: 'center', 
          justifyContent: 'space-between',
          my: 2
        }}>
          <Typography variant="body1" fontWeight={500} sx={{ mr: 2, minWidth: '150px' }}>
            {t('initialInvestment')}:
          </Typography>
          <TextField
            value={displayValue}
            onChange={handleInvestmentChange}
            variant="outlined"
            size="small"
            fullWidth
            InputProps={{
              startAdornment: <InputAdornment position="start">JPY</InputAdornment>,
            }}
            error={Boolean(error)}
            helperText={error}
            sx={{
              '& .MuiOutlinedInput-root': {
                borderRadius: 1,
                fontWeight: 500
              }
            }}
          />
        </Box>

        <Box sx={{ 
          display: 'flex', 
          alignItems: 'center', 
          justifyContent: 'space-between',
          my: 2
        }}>
          <Typography variant="body1" fontWeight={500} sx={{ mr: 2, minWidth: '150px' }}>
            {t('printableArea')}:
          </Typography>
          <Typography variant="body1" fontWeight={500}>
            {formatNumber(PRINTER_SPECIFICATIONS.printableArea.width, 0)}mm × {formatNumber(PRINTER_SPECIFICATIONS.printableArea.height, 0)}mm
          </Typography>
        </Box>
      </Box>
    </Popover>
  );
};

export default PrinterInfoPopover;
